--Crear la tabla
drop table if exists catalogos.iso_ciudad;
create table catalogos.iso_ciudad
(
    id_iso_ciudad serial
        constraint iso_ciudad_pk
            primary key,
    descripcion varchar(200),
    codigo_pais varchar(10),
    codigo_ciudad varchar(20)
);

comment on table catalogos.iso_ciudad is 'Codigos de ciudades de acuerdo al ISO 3166-2';

comment on column catalogos.iso_ciudad.descripcion is 'Nombre de la ciudad';

comment on column catalogos.iso_ciudad.codigo_pais is 'Codigo de acuerdo al mismo ISO 33162';

comment on column catalogos.iso_ciudad.codigo_ciudad is 'codigo de la ciudad';

alter table catalogos.iso_ciudad owner to dba;

create index iso_ciudad_descripcion_index
    on catalogos.iso_ciudad (descripcion);


